    "# Phase 1: Ask\n",
    "## Guiding Questions\n",
    "**What is the problem I need to solve?**\n",
    "\n",
    "The problem to be solved in this case study is to analyze smart device usage data and derive insights to help guide the marketing strategy for Bellabeat, a high-tech manufacturer of health-focused products for women. This involves identifying trends in smart device usage, figuring out how these trends might apply to Bellabeat customers, and making recommendations for how these trends can influence Bellabeat's marketing strategy.\n",
    "\n",
    "**Specifically, the tasks to solve this problem include:**\n",
    "\n",
    "* Analyzing smart device usage data to identify major trends.\n",
    "* Applying these trends to one Bellabeat product to see how it can benefit from these consumer behaviors.\n",
    "* Deriving insights from the data to help influence Bellabeat's marketing strategy.\n",
    "* Producing a report with a clear summary of the business task, a description of data sources used, documentation of any data cleaning or manipulation, a summary of the analysis, supporting visualizations and key findings, and high-level content recommendations based on the analysis.\n",
    "\n",
    "**Identify Business Task**\n",
    "\n",
    "The business task, in this case, is to analyze the data on the usage of non-Bellabeat smart devices to understand trends in consumer behavior. I have to select one Bellabeat product and apply the insights from Fitbit data to help me guide a detailed marketing strategy to make Bellabeat grow its position in the global smart device market.\n",
    "\n",
    "**Key Stakeholders**\n",
    "\n",
    "Urška Sršen: Bellabeat’s co-founder and Chief Creative Officer\n",
    "Sando Mur: Mathematician and Bellabeat’s co-founder\n"
   ]
  },
