    "# Phase 2: Prepare \n",
    "\n",
    "The data I will be using comes from a public dataset made available through [Mobius](https://www.kaggle.com/arashnic) that took responses from a 30 individuals who consented to submit their personal tracking data recorded by their devices. Information such as daily activity, steps, intensity, calories, and heart rate are made available.\n",
    "\n",
    "**Limitations**\n",
    "\n",
    "Number of Participants: \n",
    "\n",
    "A sample size of 30 is adequate. However, a much larger sample size would provide more accurate results when considering the population as a whole. Moreover, many datasets don't represent all 30 of the participants that are present. For example, the weightLog dataset contains only 8 of the 30 participants in this study. \n",
    "\n",
    "Data Formatting:\n",
    "Data types are inconsistent throughout all the tables. The date format must be changed so that each table can be compared to each other. "
   ]
  },
