    "# Now that the names are clean, I noticed that the date datatype is chr and not date on the weightLog table. \n",
    "# Let's change that here\n",
    "# First, I'll seperate date, time, and AM/PM into 3 different columns in the weightLog dataset\n",
    "weightLog <- weightLog %>%\n",
    "    separate(date, into = c(\"activity_date\", \"time\"), sep = \" \", extra = \"merge\") %>%\n",
    "    separate(time, into = c(\"hour\", \"am/pm\"), sep = \" \", extra = \"merge\")\n",
    "\n",
    "\n"
