    "# Phase 4: Analyze\n",
    "\n",
    "### Now that my data is stored appropriately, I can put it into work.\n",
    "\n",
    "### I will analyze the following:\n",
    "* Does daily steps lead to weight loss over time?\n",
    "* Does more steps lead to higher calorie consumption per day?\n",
    "* What is the min, max, mean heart rate for each person? How does that compare to what other sources say about heart rate?\n",
    "* What is the average sleep time, and what is the reccomended amount of sleep time?\n",
    "* How frequently do people use their smart devices?\n",
    "* Are people getting enough steps?"
   ]
