   "source": [
    "## Findings\n",
    "Many of the participants in this dataset did not actively record their weight daily, and they most likely did not wear their tracking devices daily because daily steps are not recorded consistently either.\n",
    "\n",
    "The two participants that continuously tracked their weight and wore their tracking devices had drastically different number of steps per day, and their weight remained fairly constant. \n",
    "\n",
    "One limitation in this finding is that the amount of time taken to record the data was about one month, which would not provide accurate weight loss statistics as weight is typically lost over a much higher time length. \n",
    "\n",
    "This does not mean that there isn't a chance that more steps correlates with weight loss over time because the data provided from these tables were not sufficient enough to find any relationship. "
   ]
  },
