   "source": [
    "## Findings\n",
    "More steps per day seems to be positively correlated with higher calorie consumption; however, the relationship isn't very strong. Individuals who walk 0-10,000 steps in one day can eat from 1000-3000 calories per day generally. \n",
    "\n",
    "The amount of calorie consumption seems to rise consistently after individuals meet the 10,000 step mark.\n",
    "\n",
    "I will continue my analysis by analyzing what the predicted amount of calories is consumed based on total steps by creating a linear model."
   ]
